import React, { Component } from "react";
class CenterDetails extends Component {
  state = {};
  render() {
    return <h1>Center details: {this.props.match.params.id}</h1>;
    <h2>Center location: {this.props.match.params.location}</h2>;
  }
}

export default CenterDetails;
